package Introduction;

public class Logical {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		System.out.println((20>10) && (10>5));
		System.out.println((20>10) && (10<5));

		System.out.println((20<10) || (10<5));
		System.out.println((20>10) || (10<5));
		System.out.println(!((20>10) && (10>5)));



	}

}
